/** @format */
import "./SignOut.css";
import { Button } from "antd";

export const SignOut = () => {
  return (
    <div className="signUp">
      <Button
        className="signInUp_button signUp"
        variant="contained"
      >
        <div style={{ color: "white" }}>Đăng xuất</div>
      </Button>
    </div>
  );
};
